import { motion } from 'framer-motion';

export const container = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 0,
        transition: {
            delay: .2,
            duration: 1.25,
            when: "beforeChildren"
        }
    }
}

export const header = {
    init: {
        backgroundColor: 'rgba(83, 83, 83, .0)'
    },
    after: {
        backgroundColor: 'rgba(83, 83, 83, .15)',
        transition: {
            delay: .2,
            duration: 1.25,
            when: "beforeChildren"
        }
    }
}

export const leterOne = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .8,
            duration: 1.25
        }
    }
}

export const leterTwo = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: 1,
            duration: 1.25
        }
    }
}

export const leterThree = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: 1.2,
            duration: 1.25
        }
    }
}

export const navRow = {
    init: {
        opacity: 0
    },
    after: {
        opacity: 1,
        transition: {
            delay: .2,
            duration: 1.25,
        }
    }
}

export const rowLink = {
    init: {
        backgroundColor: 'rgba(83, 83, 83, .0)'
    },
    after: {
        backgroundColor: 'rgba(83, 83, 83, .15)',
        transition: {
            delay: .2,
            duration: 1.25,
        }
    }
}
